import React from 'react'
import { Container, Card, Title, Text } from './styles/app.styles'
import { Player } from "video-react"

function App() {
  return (
    < Container >

      <Title> Seja Bem Vindo!, Abra o video e mude sua vida! </Title>
      <Card>
        <Player
          width="10px"
          height="10px"
          playsInline
          src="https://www.youtube.com/watch?v=JaS17E2QVq0&list=RDMMJaS17E2QVq0&start_radio=1"
        />

      </Card>

    </Container >
  );
}

export default App;
